import React from 'react';
import Card from './components/cards';
import sdata from './components/Sdata';

const App =()=>(
  
    <>
  <div className="container">
  <h1>
    List of 3 best Nextflix series
  </h1>
  <div className="flex">
  {sdata.map((val)=>{
   return(
  <>
    <Card
    key={val.id}
    imgsrc={val.imgsrc}
    title={val.title}
    sname={val.sname}
    links={val.links}/> 
  </>
  )}
  )}

  </div>
  </div>
   </>
);

export default App;
